import './App.css';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import PageRouter from './Router';
import { Helmet } from 'react-helmet'

function App() {
  return (
    <>
    <Navbar />
    <Helmet>
      <title>BBK Golf Outing</title>
    </Helmet>
    <PageRouter />
    <Footer />
    </>
  );
}

export default App;
